#
# Structure for table "user_privileges"
#

DROP TABLE IF EXISTS `user_privileges`;
CREATE TABLE `user_privileges` (
  `auto_id` smallint(5) unsigned NOT NULL AUTO_INCREMENT,
  `url` varchar(50) NOT NULL DEFAULT '0',
  `desc` varchar(255) NOT NULL DEFAULT '0' COMMENT '该路由的说明',
  PRIMARY KEY (`auto_id`)
) ENGINE=InnoDB AUTO_INCREMENT=41 DEFAULT CHARSET=utf8 COMMENT='角色权限表';

